import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class Card extends Component {
  render() {
    return(
      <div>
        Card
      </div>
    )
  }
}

class Cardlist extends Component {
  render() {
    return(
      <Card />
    )
  }
}

class App extends Component {
  render() {
    return(
      <div>
        <Cardlist />
      </div>
    )
  }
}

export default App;
